A [[mobile network operator]] or MNO (also known as a wireless service provider, wireless carrier, cellular company, or mobile network carrier) is a provider of [[wireless communications]] services. The main MNOs in Europe are listed below.

{{Further|List of Turkey mobile virtual network operators}}
[[Turkey]] has 91.3 million subscribers in total, or a 107.1% penetration rate.<ref name=":1">{{Cite web |title=BTK Q2 2023 report |url=https://www.btk.gov.tr/uploads/pages/pazar-verileri/2023-2-kurum-disi.pdf |access-date=Oct 2, 2023}}</ref> (Q2 2023)

The telecom regulator in Turkey is Information and Communication Technologies Authority (BTK : Bilgi Teknolojileri ve İletişim Kurumu).

{{Further|List of United Kingdom mobile virtual network operators}}
The [[United Kingdom]] has 92.0 million subscribers in total, or an approximate 139% penetration rate (31 December 2017).<ref>{{cite web|title=The Communications Market 2018|url=https://www.ofcom.org.uk/research-and-data/multi-sector-research/cmr/cmr-2018/interactive|work=Ofcom.org.uk|access-date=29 September 2018}}</ref>

The country's telecom regulator is [[Ofcom]].
